import React from 'react';
import Map from './Map';
import {connect} from 'react-redux';
import './Location.css';

const Location = ({LatAndLng}) => {
    return (
        <div className="container location-map">
            <Map coords={LatAndLng}/>
            <div className="row container">
                <div className="col s6">
                    <img src="https://www.theapplepost.com/wp-content/uploads/2019/05/Apple-Xinyi-A13-Roof-The-Apple-Post.jpg" 
                    alt="" style={{width: "100px", height: "100px", margin: "2rem 0"}}/>
                </div>
                <div className="col s6">
                    <h4>Storename: LOBINTON</h4>
                    <p>Address: No.45, Shifu Rd., Xinyi Dist., Taipei City, Taiwan (R.O.C.)</p>
                    <p>Phone: (123)456-7890</p>
                    <p>Business Hour: 11:00 AM - 9:30 PM</p>
                </div>
            </div>
        </div>
    )
}

const mapStateToProps = (state) => {
    return{
        LatAndLng: state.LatAndLng
    }
}

export default connect(mapStateToProps)(Location);
